import axios from 'axios';

const NursenavigatorUrl="https://tumorboard.el.r.appspot.com/getNursenavigator";

class Nursenavigtor{

    getApiN(){
        return axios.get(NursenavigatorUrl);
    }
}


export default new Nursenavigtor();
